import mongoose from "mongoose";

const userSchema = new mongoose.Schema({
  name : {
    type : String,
    required : true
  },
  email :{
    type : String,
    required : true,
    unique : true
  },
  password :{
    type : String,
    required : true
  },
  image :{
    type : String,
    default : 'url(data:image/png;base64,)'
  },
  address :{
    type : Object,
    default : {line1 : "", line2 : ""}
  },
  gender :{
    type : String,
    default : "Not Selected"
  }, 
  dob :{
    type : String,
    default : "Not Selected"
  },
  phone :{
    type : String,
    default : "0000000"
  }
})

if (!mongoose.models.doctor) {
  mongoose.model('doctor', userSchema);
}
const userModel = mongoose.model("User", userSchema);
export default userModel;
